beyerdynamic TG V56 コンデンサーマイク<br><br>Touring Gearシリーズ ハンドマイクロホン<br><br>コンデンサーマイクならではの特色をうまく活かしたステージ用コンデンサーマイクロホンです。Touring Gearシリーズで最軽量の265gという軽量設計の為、ステージだけでなく会議などでもお使いいただけます。抜けの良い高域ときめ細やかなサウンドが求められる女性ボーカルなどに最適です。<br><br>・コンデンサー型<br>・周波数特性：40～20,000Hz<br>・指向特性：カーディオイド<br>・ファンタム電源：12～48V<br>・寸法:全長 180mm, 直径 48mm（マイクヘッド部）、26mm（マイクシャフト部）<br>・コネクター：XLR3ピンオス型<br>・付属品：マイククランプ、収納ケース<div style="background:#C00; color:#fff; margin:0; width:200px; text-align:center; padding:5px 10px; font-size:90%; border-top-left-radius:5px; border-top-right-radius:5px;">配送方法について</div>
