beyerdynamic TG I56 楽器用 コンデンサーマイク<br><br>Touring Gearシリーズ 楽器用マイクロホン<br><br>アコーディオン用に製造された特別なコンデンサーマイクです。鳴りの良いマイキングポイントまで充分届く110mmのロンググースネックが特徴です。 振動による雑音を吸収するECS構造で激しいパフォーマンスで発生する振動ノイズも吸収します。<br><br>※ミニXLR4コネクター仕様なので、XLR3に変換するにはMA-PVA変換アダプターが必要です。<br><br>・コンデンサー型<br>・周波数特性：30～20,000Hz<br>・指向特性：カーディオイド<br>・コネクター：4ピンXLRメス<div style="background:#C00; color:#fff; margin:0; width:200px; text-align:center; padding:5px 10px; font-size:90%; border-top-left-radius:5px; border-top-right-radius:5px;">配送方法について</div>
