beyerdynamic TG Drum set M ドラム用マイクセット<br><br>ドラムセットに最適なTouring gearシリーズマイクセットです。<br><br>バスドラム専用ダイナミック型マイク「TG D50」を1本。<br>タムやスネアに最適な「TG D35」を4本。<br>ハイハットなどの金物に最適なコンデンサーマイク「TG I53」を2本。<br>計7本をセットにしたドラムセット向けのパッケージです。<br><br>マイククランプ、ケース付。<br><br>■TG D50<br>音作りの方向性にあわせて特性を変えられる切替スイッチを搭載したバスドラム専用ダイナミック型マイクです。必要に応じて周波数特性を切り替え可能で、フラットで加工しやすいリニアな特性か、バスドラムに最適化された特性をスイッチ1つで簡単に選択できます。アタック感溢れるクリアなビートを伝えます。<br><br>・ダイナミック型<br>・周波数特性：50～17,000Hz<br>・指向特性：カーディオイド<br>・寸法:全長104mm, 直径41mm（マイクヘッド部）、24mm（マイクシャフト部）<br>・コネクター：XLR3ピンオス型<br><br><br>■TG D35<br>ドラムやパーカッション、楽器にも使用できるプロフェッショナルマイクです。タムやスネアに最適ですが、パワフルでクリアなサウンドは他のアプリケーションでも活躍します。<br><br>・ダイナミック型<br>・指向特性：スーパーカーディオイド<br>・周波数特性：40～17,000Hz<br>・寸法:全長72mm, 直径35mm（マイクヘッド部）、28.5mm（マイクシャフト部）<br>・コネクター：XLR3ピンオス型<br>・付属：MKV 87 マイククランプ<br><br><br>■TG I53<br>スティックタイプのコンデンサーマイクです。小型かつ軽量な筐体は、カーボンにより補強され優れた強度を発揮します。極めてワイドな特性で、ハイハットなど金物をはじめとして様々な用途でクリアなサウンドを取り出すことが可能です。<br><br>・コンデンサー型<br>・周波数特性：20～20,000Hz<br>・指向特性：カーディオイド<br>・寸法：19.5（幅）×100（高さ）<br>・コネクター：3ピンXLRオス<br>・付属品：マイククランプ、専用ケース<div style="background:#C00; color:#fff; margin:0; width:200px; text-align:center; padding:5px 10px; font-size:90%; border-top-left-radius:5px; border-top-right-radius:5px;">配送方法について</div>
