beyerdynamic TG D57 ドラム用 コンデンサーマイク<br><br>Touring Gearシリーズ ドラムマイクロホン<br><br>タムやスネアでの使用に最適化されたクリップオンタイプのコンデンサーマイクロホンです。通常のグースネック構造、ダイナミックマイクTG D52dと併用してドラムセットをマイキングすることで、メリハリのあるドラムサウンドを得られます。<br><br>・コンデンサー型<br>・ファンタム電源：12～48V<br>・周波数特性：20～20,000Hz<br>・指向特性：カーディオイド<br>・寸法:85×118mm（クランプ）、72mm（グースネック）<br>・コネクター：XLR3ピンオス型<div style="background:#C00; color:#fff; margin:0; width:200px; text-align:center; padding:5px 10px; font-size:90%; border-top-left-radius:5px; border-top-right-radius:5px;">配送方法について</div>
