beyerdynamic TG V50d ダイナミックマイク<br><br>Touring Gearシリーズ ハンドマイクロホン<br><br>明瞭なボーカルサウンドを実現する専用チューニングを施したボーカル用ダイナミックマイクです。5kHz付近と10kHz付近にピークを設定してボーカルの輪郭を強調。 滑りにくく美しい仕上げのボディながら重量は270gと軽量な為長時間の使用にも適しています。会議用としても最適なマイクロホンです。<br><br>・ダイナミック型<br>・周波数特性：50～17,000Hz<br>・指向特性：カーディオイド<br>・寸法:全長 185mm、 直径 54mm（マイクヘッド部）、23/35mm（マイクシャフト部）<br>・コネクター：XLR3ピンオス型<br>・付属品：マイククランプ、収納ケース<div style="background:#C00; color:#fff; margin:0; width:200px; text-align:center; padding:5px 10px; font-size:90%; border-top-left-radius:5px; border-top-right-radius:5px;">配送方法について</div>
